import React,{Component} from 'react';
import {Form,Row,Col,Button} from 'react-bootstrap';
class EnterQuiz extends Component{
    render(){
        return(
            <React.Fragment>
                <Row>
                    <Form.Group>
                        <Form.Label>Enter Code to Join</Form.Label>
                        <Form.Control type='text' placeholder="Enter the code " />
                        <Button>Enter</Button>
                    </Form.Group>
                </Row>
            </React.Fragment>
        );
    }
}

export default EnterQuiz;
